create or replace procedure inserting_into_transport_route_info(_date date) as $$
declare
	id_transport int;
	id_route_info int;
	id_cur cursor for select route_info_id from route_info where date = _date;
	id_of_routes_info_on_date record;
begin
	open id_cur;
	fetch id_cur into id_route_info;
	
	for id_transport in (select transport_id from transport) loop
		while (select type_id from depot
			  where depot_id = (select depot_id from transport
							   where transport_id = id_transport)) != 
			  (select type_id from route
			   where route_id = (select route_id from route_info
								 where route_info_id = id_route_info))
		loop
			fetch id_cur into id_route_info;
			if not found then
				close id_cur;
				open id_cur;
				fetch id_cur into id_route_info;
			end if;
		end loop;
	end loop;
end;
$$ language plpgsql;

call inserting_into_transport_route_info('2023-12-30');
call inserting_into_transport_route_info('2023-12-31');


